import React from "react";
import "./style.css";
function Card(props) {
  return (
    <div>
      <div className="card">
        <div className="top">
          <h2 className="name">{props.name}</h2>
          <img className="circle-img" src={props.img} alt="" srcset="" />
        </div>
        <div className="bottom">
          <p className="info"> {props.info}</p>
        </div>
      </div>
    </div>
  );
}
function App() {
  return (
    <div>
      <h1 className="heading">Personagens</h1>
      <div className="card">
        <div className="top">
          <h2 className="name">Satoro Gojo</h2>
          <img
            className="circle-img"
            src="https://dimensaosete.com.br/static/7fc311549694666167a49cdb0fb1293c/2493a/gojo.webp"
            alt=""
          />
        </div>
        <div className="bottom">
          <p className="info">Você é fraco</p>
        </div>
      </div>
    </div>
  );
}

export default App;
